DROP TABLE IF EXISTS dt01_gen_auth_url_sign_dt;

CREATE TABLE `dt01_gen_auth_url_sign_dt` (
  `ORG_ID` varchar(36) NOT NULL,
  `URL_ID` varchar(36) NOT NULL,
  `REQUEST_ID` varchar(36) NOT NULL,
  `USER_IDENTIFIER` varchar(1000) NOT NULL,
  `URL` varchar(1000) NOT NULL,
  `STATUS` varchar(1) NOT NULL DEFAULT '0' COMMENT '0 : New / File Baru Di Upload\r\n1 : Success Execute Sign\r\n2 : Document Success Sign\r\n3 : File Berhasil Di Download',
  `ACTIVE` varchar(1) NOT NULL DEFAULT '1',
  `CREATED_DATE` datetime NOT NULL DEFAULT current_timestamp(),
  PRIMARY KEY (`URL_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




DROP TABLE IF EXISTS dt01_gen_document_file_dt;

CREATE TABLE `dt01_gen_document_file_dt` (
  `ORG_ID` varchar(36) NOT NULL,
  `NO_FILE` varchar(100) NOT NULL,
  `FILENAME` varchar(1000) DEFAULT NULL,
  `JENIS_DOC` varchar(10) DEFAULT NULL,
  `ASSIGN` varchar(1000) DEFAULT NULL,
  `STATUS_SIGN` varchar(1) NOT NULL DEFAULT '0' COMMENT '0 : File Not Uploaded / File Belum Di Upload\r\n1 : Files Have Been Uploaded / File Sudah Di Upload\r\n2 : Request Sign / Sedang Process Pengajuan Tanda Tangan\r\n3 : Sign Success / Tanda Tangan Berhasil',
  `LINK` varchar(1000) DEFAULT NULL,
  `PASIEN_IDX` varchar(1000) DEFAULT NULL,
  `TRANSAKSI_IDX` varchar(1000) DEFAULT NULL,
  `ACTIVE` varchar(1) NOT NULL DEFAULT '1',
  `CREATED_DATE` datetime NOT NULL DEFAULT current_timestamp(),
  `REQUEST_ID` varchar(36) DEFAULT NULL,
  `NOTE` text NOT NULL,
  PRIMARY KEY (`NO_FILE`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;




